import React, { useState, useEffect, useRef } from "react";
import './ProductList.css'; // مطمئن شو این فایل هست و در مسیر درسته

const products = [
  { id: 1, name: "غذای خشک گربه نوع یک", price: "400.000 تومان",images:"/images/cat1.jpg"},
  { id: 2, name: "غذای خشک گربه نوع دو", price: "400.000تومان",images:"/images/cat2.jpg" },
  { id: 3, name: "غذای خشک گربه نوع سه", price: "400.000تومان",images:"/images/cat1.jpg" },
  { id: 4, name: "غذای خشک گربه نوع چهار", price: "400.000تومان", },
  { id: 5, name: "غذای خشک گربه نوع پنج", price: "400.000تومان" },
  { id: 6, name: "غذای خشک گربه نوع شش", price: "400.000تومان" },
];

function ProductSliderWithStaticCard() {
  const [startIndex, setStartIndex] = useState(0);
  const maxStartIndex = products.length - 3;
  const intervalRef = useRef(null);

  useEffect(() => {
    startAutoSlide();
    return () => stopAutoSlide();
  }, []);

  const startAutoSlide = () => {
    stopAutoSlide();
    intervalRef.current = setInterval(() => {
      setStartIndex((prevIndex) =>
        prevIndex < maxStartIndex ? prevIndex + 1 : 0
      );
    }, 3000);
  };

  const stopAutoSlide = () => {
    if (intervalRef.current) clearInterval(intervalRef.current);
  };

  const handleNext = () => {
    stopAutoSlide();
    setStartIndex((prev) => (prev < maxStartIndex ? prev + 1 : 0));
    startAutoSlide();
  };

  const handlePrev = () => {
    stopAutoSlide();
    setStartIndex((prev) => (prev > 0 ? prev - 1 : maxStartIndex));
    startAutoSlide();
  };

  const visibleProducts = products.slice(startIndex, startIndex + 3);

  return (
    <div className="container my-4">
      <div className="row g-3">
        {/* کارت ثابت */}
        <div className="col-md-3">
          <div className="card text-center h-100 shadow">
            <div className="card-body d-flex flex-column justify-content-between">
              <div>
                <h5 className="card-title text-danger fw-bold">آف پت وودمارت</h5>
              </div>
              <div>
                <button className="btn btn-warning my-3 fw-bold">اینجا کلیک کنید</button>
              </div>
              <div>
                <img
                  src="https://via.placeholder.com/100x100"
                  alt="Pet Sale"
                  className="img-fluid"
                />
              </div>
            </div>
          </div>
        </div>

        {/* اسلایدر کارت‌ها */}
        <div className="col-md-9">
          <div className="row slider-row transition">
            {visibleProducts.map((product) => (
              <div className="col-md-4" key={product.id}>
                <div className="card h-100 shadow-sm">
                  <img
                    src={`https://via.placeholder.com/300x200?text=${encodeURIComponent(product.name)}`}
                    alt={product.name}
                    className="card-img-top"
                  />
                  <div className="card-body text-center d-flex flex-column justify-content-between">
                    <div>
                      <h5 className="card-title">{product.name}</h5>
                      <p className="card-text text-success fw-bold">{product.price}</p>
                    </div>
                    <button className="btn cute-orange-btn mt-3">افزودن به سبد خرید</button>
                  </div>
                </div>
              </div>
            ))}
          </div>

          {/* دکمه‌های کنترل پایین */}
          <div className="d-flex justify-content-center mt-3">
            <button className="slider-btn me-2" onClick={handlePrev}>
              قبلی
            </button>
            <button className="slider-btn" onClick={handleNext}>
              بعدی
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ProductSliderWithStaticCard;
